import Vue from 'vue';
import Vuex from 'vuex';
Vue.use(Vuex);
import state from "../store/state.js"; // import actions from '../store/actions.js'

import mutations from "../store/mutations.js"; // import getters from '../store/getters.js'

import banner from "../store/modules/banner.js";
import column from "../store/modules/column.js";
import detail from "../store/modules/detail.js";
import follow from "../store/modules/follow.js";
import home from "../store/modules/home.js";
import user from "../store/modules/user.js";
import buycar from "../store/modules/buycar.js";
var store = new Vuex.Store({
  state: state,
  mutations: mutations,
  modules: {
    banner: banner,
    column: column,
    detail: detail,
    follow: follow,
    home: home,
    user: user,
    buycar: buycar
  }
});
export default store;
